import React from 'react';
import { useRecoilValue } from 'recoil';
import * as atoms from '../../navigation/atoms';

const styles = {
  card: {
    position: 'relative',
    display: 'flex',
    alignItems: 'flex-start',
    justifyContent: 'flex-start',
    width: '13.5vw',
    height: '7vw',
    boxShadow: 'inset 0 2px #b14eb4, inset inset 0 -2px #440247',
    borderRadius: '10px',
    background: 'linear-gradient(130deg, #a631a6, #631e67)',
    boxSizing: 'border-box',
    alignSelf: 'flex-start',
    padding: '1vh'
  } as React.CSSProperties,

  masterCard: {
    width: '3vh',
    height: '3vh',
    marginLeft: 'auto'
  } as React.CSSProperties
};

const CreditCard = (props: any) => {
  return (
    <div style={styles.card}>
      <img style={styles.masterCard} 
           src={process.env.PUBLIC_URL + '/media/chip/mastercard.svg'} />

      <div className='chip'></div>
    </div>
  )
}

export default CreditCard;
